import Input from "../components/input";
import { useState } from 'react';
const About = () => {
    const [parentCount,setParentCount] = useState('')
    const fu =(data)=>{
        setParentCount(data)
    }
    return (
        <div className="About">
            <Input fu={fu}/>
            {parentCount}
        </div>
    );
}

export default About;
